const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course={course} />
      <Content content={part1} excercise={exercises1} />
      <Content content={part2} excercise={exercises2} />

      <p>
        {part2} {exercises2}
      </p>
      <p>
        {part3} {exercises3}
      </p>
      <p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
    </div>
  )
}


const Header =(props) =>{
  return(

    <h1>{props.course}</h1>

  )
}

const Content = (props) => {
  return (
    <p>{props.content} {props.excercise}</p>
  )
}
const Total = (props) =>{
  return(
    <p>
      {props.total}
    </p>
  )
}
export default App
